import ReactDOM from 'react-dom';
import { configureAnchors } from 'react-scrollable-anchor'

import App from './components/app';

configureAnchors({offset: -60, scrollDuration: 200})

ReactDOM.render(<App/>,
  document.getElementById('root')
);
